  searchForText() {
    if (this.searchQuery.length > 4) {
        this.transcriptionService.getTransriptForWord(this.searchQuery).subscribe(value => {
            // console.log(JSON.stringify(value));
            this.matches = value;
            if (this.matches.length > 0) {
              this.first = 0;
            } else {
              this.messageService.add({
                severity: 'info',
                summary: 'Sin resultados',
                detail: 'No se encontraron resultados'
              });
            }
          }
        );
    } else {
      this.messageService.add({
        severity: 'warn',
        summary: 'Sin consulta',
        detail: 'Por favor especifique un trmino de bsqueda con al menos 5 letras'
      });
    }
  }

  onPageChange($event: PaginatorState) {
    this.first = $event.first || 0;
  }

